import React from "react";
import { NavLink } from "react-router-dom";

const AdminProfile = () => {
  return (
    <div style={styles.layout}>
      {/* Sidebar */}
      <div style={styles.sidebar}>
        <h2 style={styles.logo}>🛠️ Admin Panel</h2>
        <ul style={styles.navLinks}>
          <li><NavLink to="/Dashboard" style={styles.link}>📊 Dashboard</NavLink></li>
          <li><NavLink to="/admin-inquiries" style={styles.link}>📩 Inquiries</NavLink></li>
          <li><NavLink to="/admin-admissions" style={styles.link}>🎓 Admissions</NavLink></li>
          <li><NavLink to="/admin-payments" style={styles.link}>💳 Payments</NavLink></li>
          <li><NavLink to="/admin/reports" style={styles.link}>📑 Reports</NavLink></li>
          <li><NavLink to="/admin/users" style={styles.link}>👥 Users / Roles</NavLink></li>
        </ul>
      </div>

      {/* Main Content */}
      <div style={styles.page}>
        <h1 style={styles.pageTitle}>👨‍💼 Admin Profile</h1>

        <div style={styles.profileHeader}>
          <img
            src="https://i.pravatar.cc/120?u=admin"
            alt="Admin Avatar"
            style={styles.avatar}
          />
          <div>
            <h2>Admin User</h2>
            <p>📧 admin@example.com</p>
            <p>🔑 Role: Super Admin</p>
          </div>
        </div>

        <div style={styles.card}>
          <h3>Account Info</h3>
          <p><strong>User ID:</strong> ADMIN001</p>
          <p><strong>Created At:</strong> {new Date().toLocaleDateString()}</p>
          <p><strong>Last Updated:</strong> {new Date().toLocaleString()}</p>
        </div>
      </div>
    </div>
  );
};

const styles = {
  layout: {
    display: "flex",
    height: "100vh",
    fontFamily: "Arial, sans-serif",
  },
  sidebar: {
    width: "250px",
    background: "#2c3e50",
    color: "#fff",
    padding: "20px",
  },
  logo: {
    marginBottom: "20px",
    fontSize: "22px",
    fontWeight: "bold",
  },
  navLinks: {
    listStyle: "none",
    padding: 0,
  },
  link: {
    display: "block",
    color: "#ecf0f1",
    textDecoration: "none",
    padding: "10px 0",
    fontSize: "16px",
  },
  page: {
    flex: 1,
    padding: "30px",
    background: "#ecf0f1",
    overflowY: "auto",
  },
  pageTitle: {
    fontSize: "24px",
    marginBottom: "20px",
  },
  profileHeader: {
    display: "flex",
    alignItems: "center",
    gap: "20px",
    marginBottom: "20px",
  },
  avatar: {
    borderRadius: "50%",
    width: "120px",
    height: "120px",
    border: "3px solid #2c3e50",
  },
  card: {
    background: "#fff",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
  },
};

export default AdminProfile;
